import React from "react";
import { CiLocationOn } from "react-icons/ci";

function HowItWorks() {
  return (
    <div className="HowItWorks">
      <div className="HowItWorks-container">
        <h1>How it works</h1>
        <p>
          Our vehicles are well-maintained and reliable, ensuring a smooth and
          comfortable ride.
        </p>
        <div className="steps-on-how">
          <div className="step">
            <h2>
              <CiLocationOn />
            </h2>
          </div>
        </div>
      </div>
    </div>
  );
}

export default HowItWorks;
